import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <Router>
      <div>
        <NavbarContent />
        <Routes>
          <Route path="/" element={<Home />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
